import FormControlLabel from '@mui/material/FormControlLabel';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';

const FilterFrequencyType = props => {
    return (
      <FormControl onClick={props.filterFrequencyTypeTC}>
      {/* <FormLabel id="demo-radio-buttons-group-label">FrequencyType</FormLabel> */}
      <RadioGroup
        row
        aria-labelledby="radio-buttons-group-label"
        defaultValue=""
        name="radio-buttons-group-frequency-type"
      >
        <FormControlLabel value="fundamental" control={<Radio color="secondary"/>} label="Fundamental" sx={{color: 'red'}}/>
        <FormControlLabel value="with multiplication" control={<Radio />} label="with Multiplication" style={{color: ''}}/>

      </RadioGroup>
    </FormControl>
    )
  }

  export default FilterFrequencyType
